import React, { Component } from 'react';
import Dialog_Picture from './images/Dialog.png';
import Map_Picture from './images/Map.png';

export class SeoulRouteMakerContent extends Component {
    render() {
        return (
            <div style={{overflowX: "hidden", overflowY: "auto", height: "550px"}}>
                <h2>0. Introduction</h2>
                <img src={Dialog_Picture} style={{width: "900px"}}/>
                <img src={Map_Picture} style={{width: "900px"}}/>
                <h2>1. Architect</h2>
                <h3>1.1 Use-Case Diagram</h3>
                <h3>1.2 Function Specification</h3>
                <h3>1.3 DataBase Architects</h3>

                <h2>2. Implementation</h2>
                <h3>2.1 User Perspective</h3>
                <h3>2.2 Manager Perspective</h3>

                <h2>0. Conclusion</h2>

                <h2>Appendix A. References</h2>

            </div>
        )
    }
}

export default SeoulRouteMakerContent
